  `boost_clock` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `tdp` int NOT NULL,
  `graphics` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `smt` tinyint(1) DEFAULT NULL,
  `description` longtext COLLATE utf8mb4_unicode_ci,
  `status` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'available',
  `condition` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `purchase_count` int NOT NULL DEFAULT '0',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `cpus_product_id_foreign` (`product_id`),
  CONSTRAINT `cpus_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE
